import React from 'react'

const Portfolio = () => {
  return (
    <div name="portfolio" className='w-full h-screen pt-[60px] bg-[#F3E5FA]'>
      <div className='max-w-[1100px] mx-auto p-4 flex flex-col justify-center w-full h-full'>
        <h1>Here's some info about this portfolio that you see!</h1>
      </div>
    </div>
  )
}

export default Portfolio
